import react from "react";

const TaskList = ({ id, Description, TimeFrame }) => {
    return (
        <tbody>
            <tr>
                <td>{id}</td>
                <td>{Description}</td>
                <td>{TimeFrame}</td>
            </tr>
        </tbody>
        );
};

export default TaskList;
